import React from 'react'
import Login from  "./Login"
import { BrowserRouter as Router, Route,Switch} from "react-router-dom";
import {  useState } from 'react';
import axios from 'axios'
import Access from "./access"
import Contact from "./pages/ContactPage"
import SignIn from "./signIn"
import Navbar from "./Nav/Navbar"



const BeforeLogin = ()=>{
    
  const [Session,setSession] = useState({
    isLoggedin : false ,
    currentUser : null,
    errorMessage : null
  });

  const TokenLocal = localStorage.getItem("token")
  const isloginedLocal = true;

  function  Check(){
    if(TokenLocal==null)
    {
      console.log("null")
    }
    else{
      axios
      .post(`http://localhost:1000/api/check?token=${TokenLocal}`)
      .then((res)=>{
         if(res.data==true)
         {
          localStorage.setItem("isLogined",true) 
          setSession ({
             isLoggedin : true
           })
         }
         else{
          setSession ({
            isLoggedin : false
          })
         }
      })
    }

  }

  React.useEffect(()=>{
    Check();
  }, []);

  
  return (
    <div>
       
       {
        // Session.isLoggedin ?
        isloginedLocal ? 
        (
          <Access />
        )  
        : 
        (
          <div>
            <Navbar/>
            <Router>
                <Switch>
                  <Route exact path="/" component={() =>  <Login setSession={setSession}/>} />
                  <Route path="/signIn" component={() =>  <SignIn setSession={setSession}/>}/>
                  <Route path="/contact" component={() =>  <Contact />}/>
                  <Route  component={() =>   <Login setSession={setSession}/>}/>
                </Switch>
            </Router>
          </div>
          
        )
      }
    </div>
   
  );  

}
export default BeforeLogin;
